Write-Host "Extracting to: $DestinationPath" -ForegroundColor Yellow
Write-Host ""

# Create temp file for ZIP
$tempZip = [System.IO.Path]::GetTempFileName() + ".zip"

try {
    # Decode base64 to bytes
    Write-Host "[1/3] Decoding base64 data..." -ForegroundColor Gray
    $zipBytes = [System.Convert]::FromBase64String($packageData)
    
    # Write bytes to temp ZIP file
    Write-Host "[2/3] Writing temporary ZIP file..." -ForegroundColor Gray
    [System.IO.File]::WriteAllBytes($tempZip, $zipBytes)
    
    # Extract ZIP to destination
    Write-Host "[3/3] Extracting files..." -ForegroundColor Gray
    
    # Ensure destination parent exists
    $destParent = Split-Path -Parent $DestinationPath
    if ($destParent -and -not (Test-Path $destParent)) {
        New-Item -ItemType Directory -Path $destParent -Force | Out-Null
    }
    
    # Remove existing destination if present
    if (Test-Path $DestinationPath) {
        Write-Host "    Removing existing directory..." -ForegroundColor DarkGray
        Remove-Item -Path $DestinationPath -Recurse -Force
    }
    
    # Extract using .NET (cross-platform)
    Add-Type -AssemblyName System.IO.Compression.FileSystem
    [System.IO.Compression.ZipFile]::ExtractToDirectory($tempZip, (Split-Path $DestinationPath -Parent))
    
    Write-Host ""
    Write-Host " Extraction complete!" -ForegroundColor Green
    Write-Host ""
    Write-Host "Package contents:" -ForegroundColor Cyan
    Write-Host "  - working/module/Pmc.Strict/consoleui/ClassLoader.ps1 (NEW)" -ForegroundColor White
    Write-Host "  - working/module/Pmc.Strict/consoleui/Start-PmcTUI.ps1 (UPDATED)" -ForegroundColor White
    Write-Host "  - working/module/ISSUES_FOUND.md (Analysis)" -ForegroundColor White
    Write-Host ""
    Write-Host "Next steps:" -ForegroundColor Cyan
    Write-Host "  1. cd $DestinationPath/working/module/Pmc.Strict/consoleui" -ForegroundColor White
    Write-Host "  2. .\Start-PmcTUI.ps1 -DebugLog -LogLevel 2" -ForegroundColor White
    Write-Host ""
    Write-Host "See PACKAGE_README.md for complete documentation" -ForegroundColor Gray
    
} catch {
    Write-Host ""
    Write-Host " Extraction failed: $($_.Exception.Message)" -ForegroundColor Red
    exit 1
} finally {
    # Cleanup temp file
    if (Test-Path $tempZip) {
        Remove-Item $tempZip -Force
    }
}
